$(document).ready(function() {
	
	$div = $("#whats_included-slider .plan_slider_guide");
	
	$('.plan_slider_guide div').drag(function( ev, dd ){
		//dd.offsetX = Math.min(174, Math.max(0, Math.round( dd.offsetX / 58 ) * 58))
		dd.offsetX = Math.min(175, Math.max(0,dd.offsetX/58)*58);
		$( this ).css({ left: dd.offsetX }).removeClass().addClass('price_'+Math.floor(dd.offsetX / 58) * 6 + 'mos');	
	},{ relative:true });

	$( "#accordion" ).accordion({
		active: false,
		collapsible: true
	});
	
	jQuery('#phone_slider').jcarousel({
		wrap: 'circular',
		itemVisibleOutCallback: {
            onBeforeAnimation: carouselAnimateStart
        }
	});
})

function carouselAnimateStart() {
	Cufon.refresh();
}